INSERT INTO `job_tab` (`sn`, `job_id`, `title`, `description`, `status_id`, `user_id`, `date_of_reg`, `last_updated`) VALUES
(1, 'JOB001', 'POST OF IELTS TUTOR', '<p style=\"color: #7f8c8d; font-family: body_text; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 18.75pt;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif;\"><u><span style=\"font-size: 18pt; color: black;\">Job Summary</span></u><span style=\"font-size: 11.5pt; color: #7f8c8d;\"><br />We are looking for a sales representative to maintain, develop, implement, track, optimize our financial operations and attend to our customers.</span></span></p>\n<p style=\"color: #7f8c8d; font-family: body_text; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 18.75pt;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif;\"><u><span style=\"font-size: 18pt; color: black;\">Address:</span></u><span style=\"font-size: 11.5pt; color: #7f8c8d;\"><br /></span>SamKay Tech Centre, Shop 1, 178, Akarigbo Road, Sabo, Sagamu, Ogun State.<span style=\"font-size: 11.5pt; color: #7f8c8d;\"><br /></span><u><span style=\"font-size: 18pt; color: black;\">Responsibilities</span></u><span style=\"font-size: 11.5pt; color: #7f8c8d;\"><br />- Attend to our customers.</span></span></p>\n<p style=\"color: #7f8c8d; font-family: body_text; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 18.75pt;\"><span style=\"font-size: 11.5pt; font-family: tahoma, arial, helvetica, sans-serif; color: #7f8c8d;\">- Implement financial policies and procedures.</span></p>\n<p style=\"color: #7f8c8d; font-family: body_text; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 18.75pt;\"><span style=\"font-size: 11.5pt; font-family: tahoma, arial, helvetica, sans-serif; color: #7f8c8d;\">- Ensure daily postings of receipts, invoices and cheque requisition.<br />- Establish, maintain and reconcile the general ledger.<br />- Prepare and reconcile bank statements and petty cash account reconciliation.<br />- Preparation of VAT Schedule for remittance.<br />- Ensure transactions are properly recorded.<br />- Assist in the preparation of income statements.<br />- Assist in the preparation of financial reports.<br />- Involvement in monthly Trial Balance review.<br />- Effectively carrying out all other duties as may be assigned.</span></p>\n<p style=\"color: #7f8c8d; font-family: body_text; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 18.75pt;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif;\"><u><span style=\"font-size: 18pt; color: black;\">Basic Requirements</span></u><span style=\"font-size: 11.5pt; color: #7f8c8d;\"><br />- B.Sc. /HND in Accounting.<br />- Sound knowledge&nbsp; ICT.<br />- At least 2 years of experience in the related fields.<br />- Good presentation skills.<br />- Good communication skills.<br />- Not more than 25 years of age.<br />- Additional advantage will be a pass.<br /><br /></span><u><span style=\"font-size: 17pt; color: black;\">Salary:</span></u><span style=\"font-size: 11.5pt; color: #7f8c8d;\"><br /></span><span style=\"font-size: 14pt; color: black;\">ACTRACTIVE</span><span style=\"font-size: 11.5pt; color: #7f8c8d;\"><br /><br /></span><u><span style=\"font-size: 18pt; color: black;\">Mode of Application</span></u><span style=\"font-size: 11.5pt; color: #7f8c8d;\"><br />Applicant should apply online or submit his/her Curriculum Vitae and Cover letter to<br /></span><a style=\"text-decoration: none; color: inherit;\" href=\"mailto:ebonyworldcap99@gmail.com\"><span style=\"font-size: 11.5pt;\">info@samkaytechcentre.com</span></a></span></p>\n<p style=\"color: #7f8c8d; font-family: body_text; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; line-height: 18.75pt;\"><span style=\"font-family: tahoma, arial, helvetica, sans-serif;\"><u><span style=\"font-size: 18pt; color: black;\">Deadline</span></u><span style=\"font-size: 11.5pt; color: #7f8c8d;\"><br />Till the position is filled</span></span></p>', 'PUB', 'STAFF000', '2021-08-09 13:55:05', '2021-11-21 20:57:45');
