(4, 'PRC002', 'PR004', 'KING\'S VEGETABLE OIL 10 L', 'Buy King\'s Vegetable Oil 10 L on Supermart.ng. Cooking oil is used for frying, cooking, baking and even dressing meals. We can\'t do without it in the kitchen. When preparing food, it\'s unlikely you can make any meal without using some kind of oil or ther other', 'S', '2023-04-10 16:42:59'),
