(6, 'PRC002', 'PR006', 'PALM OIL 5 L', 'Buy Palm Oil 5 L on Agrohandler.com. Palm oil is obtained from the fruit of the oil palm tree. Palm oil is used for preventing vitamin A deficiency, cancer, brain disease, aging; and treating malaria, high blood pressure, high cholesterol, and cyanide poisoning. Palm oil is used for weight loss and increasing the body\'s metabolism.\r\nPalm oil usually called Cooking Oil is used for frying, cooking, baking and even dressing meals. We can\'t do without it in the kitchen.', 'A', '2023-07-29 14:00:50'),
