(9, 'PRC007', 'PR009', 'BEEF 1 KG - CUT UP', 'Buy Beef ~1 kg - Cut Up (Market) on Supermart.ng. Beef is one of the most popular meats in Nigeria. It is a red meat and though it can be a source of nutrients and vitamins, it is best to go for lean cuts of beef that have as little fat as possible. It is very common to see someone eating a meal and waiting till the main dish is finished before tearing apart a large chunk of beef.', 'S', '2023-04-10 17:09:37'),
