(12, 'PRC007', 'PR012', 'SAWA FISH (BONGA FISH) - SMOKED X1', 'Buy Sawa Fish - Smoked x1 on Supermart.ng. Buy Sawa fish, a rich tasting seafood variety on Supermart.ng. Seafood is a highprotein food that is low in calories, total fat, and saturated fat. High in vitamins and minerals, seafood has been shown to have numerous health benefits. For example, recent studies have shown that eating seafood can decrease the risk of heart attack, stroke, obesity, and hypertension. Seafood also provides essential nutrients for developing infants and children. Most lowfat species of sea food contain less than 100 calories per 3ounce.', 'S', '2023-04-10 17:09:50'),
(13, 'PRC002', 'PR013', 'FAR EAST RICE VINEGAR 295 ML', 'Buy Far East Rice Vinegar 295 ml on Supermart.ng. When added to food, vinegar adds an acidic taste and that\'s why it is advisable to apply it sparingly and taste as your pour so you don\'t ruin the taste of teh food with too much vinegar. Vinegar is used for cooking a variety of meals.', 'S', '2023-04-10 16:43:53'),
