(15, 'PRC007', 'PR015', 'MILO SARDINES IN OIL 125 G', 'Buy Milo Sardines In Oil 125 g on Supermart.ng. Looking to make a sandwich, have a light snack or actually cook a full meal? Sardines are a good accompaniment for a variety of meals. You can use the sardines right out of the tin; it doesn\'t require cooking. Milo sardine in vegetable oil has low cholesterol and a good amount of vitamin b12, it is good for breakfast, lunch and dinner and it has nice salty taste, it is also easy to prepare One of the leading brands around the world, Milo is Moroccan manufacturer of canned food. Their products include Sardines and Tuna among others.', 'S', '2023-04-10 17:10:14'),
