(18, 'PRC008', 'PR018', 'BUY 7UP 50CL X 12 PET BOTTLES ONLINE | BUY 7UP IN LAGOS', 'Buy 7up 50cl x 12 pet bottles Online- Get inspired to mix it up a little with 7UP! Crisp and refreshing, it mixes into all kinds of drinks, cocktails, punches, baked goods, and more, perfect for your next cocktail party, game night or get-together. 7Up (stylized as 7up outside North America) or Seven Up is an American brand of lemon-lime-flavored non-caffeinated soft drink. The brand and formula are owned by Keurig Dr Pepper although the beverage is internationally distributed by PepsiCo.\r\nIngredients are filtered carbonated water and contains 2% or less of each of the following: citric acid, natural and artificial flavors, potassium benzoate (protects flavor), aspartame, potassium citrate, acesulfame potassium, red 40. Phenylketonurics: Contains phenylalanine', 'A', '2023-07-18 07:50:08'),
(19, 'PRC008', 'PR019', 'FEARLESS ENERGY DRINK CLASSIC 500 ML X 12 | BUY FEARLESS ONLINE', 'Buy Fearless Energy Drink Classic 50 cl x 12 online. Fearless are non-alcoholic energy boosting beverages that provides you limitless benefits at work, at training or sport, at play, at study, while in traffic, during the day and when itâ€™s time to get loosen up at night! \r\n Fearless come in two delicious flavors, Classic and Redberry, there is something for everyone. Whether youâ€™re looking for a classic energy drink experience or a fruity twist, Fearless Energy Drink has you covered.\r\nThe Classic flavor is packed with essential vitamins and minerals, making it the perfect choice for anyone looking for a quick and easy energy fix. With its smooth flavor and quick-acting energy, youâ€™ll love the way Fearless Energy Drink invigorates your senses and gives you the energy you need to take on the day.', 'A', '2023-07-18 07:57:53'),
