(21, 'PRC008', 'PR021', 'LIMCA PET DRINK â€“ 35CL X 12 SOFT DRINK', 'Buy Limca online in Wholesale or retail price- Limca is a carbonated soft drink that features a fresh light lemon-line taste and fun-loving attitude. Acquired by The Coca Cola Company in 1992, it owns it origin to India, where is a national treasure. Limca is a carbonated soft drink that features a fresh light lemon-line taste and fun-loving attitude.', 'A', '2023-07-18 07:48:25'),
