(511, 'PRC004', 'PR511', 'OLA-OLA CASSAVA FLOUR (LAFUN) - 1KG', 'Buy Ola-Ola cassava Flour (Lafun) on Agrohandlers.com.Cassava Flour (lafun) is cassava flour mash. It is gotten by peeling cassava tubers, washing them with clean water, and sun-drying it. After this, the dried cassava tubers are ground to powder. The cassava flour is used to produce a swallow called Lafun. This swallow is viewed as different from the amala produced by the Yoruba people of western Nigeria. Lafun is made from dried cassava tubers without fermentation. Lafun is starchy and stretchy. Aside from eating swallow, lafun flour also called elubo or cassava flour, can be used for making bread, and other pastries. Ola-Ola cassava Flour is available online in 1kg. Order Ola- Ola online on Agrohandlers today. Delivers to Lagos.', 'S', '2023-07-29 16:32:01'),
