(614, 'PRC010', 'PR614', 'GOLDEN PENNY PASTA 500G', 'Buy Golden Penny Pasta Twist online- Order your Golden Penny Pasta Twist on agrohandlers.com. Golden Penny Pasta Twist is made from Hard Wheat Flour. Enjoy competitive prices when you order Golden Penny Pasta Twist which can be delivered to you in Lagos. Golden Penny Pasta Twist gives you a great taste making it very enjoyable within the family and in the company of friends. It contains fiber and is rich in Protein and contains no cholesterol. It cooks in 5 minutes and can be enjoyed with Salads, Rice & Stew, Jolly Rice, Coconut Rice, Fried Rice also with Vegetables and some mouthwatering recipes can be made with Golden Penny Pasta Twist.', 'A', '2023-08-11 13:14:16'),
(615, 'PRC002', 'PR615', 'KINGS VEGETABLE OIL- DEVON KING\'S PURE VEGETABLE OIL - 1LT', 'Buy Devon Kings Vegetable Oil on Agrohandlers.com - Devon Kings Vegetable Oil are available online in 1L, 2 L, 3L, 5L, 10L, and 25L. Vegetable oils provide a plethora of health benefits such as reducing the risk of cardiovascular diseases, better metabolism and digestion, lowers chances of breast cancer, and provides omega-3 fatty acids to the body.', 'A', '2023-08-11 13:50:31'),
(616, 'PRC006', 'PR616', 'SWEET BEANS (EWO OLOYIN) X 1 PAINT PLASTIC', 'Beans- Buy Sweet beans in bulk market price at agrohandlers. Ewa (Beans) Oloyin is naturally sugar tasted grain. Sweet beans when cooked separately and added fried stew or as concoction can be used to eat yam, bread, plantain, etc. In Nigeria, you will hear something like Bread ati ewa (bread & beans), Plantain and beans, Yam and beans etc. Ewa oloyin is available on agrohandlers in retail and wholesale sizes / prices', 'A', '2023-08-11 14:39:45'),
(617, 'PRC006', 'PR617', 'BEANS (DRUM BEANS) EWA X 1 PAINT PLASTIC', 'Beans- Buy Drum beans in bulk market price at agrohandlers. Drum beans is bigger in size compare to sweet beans grains. drum beans is used to prepare Moimoi, Akara and can be eating based on taste preference. Ewa (Drum beans is available on agrohandlers in retail and wholesale sizes / prices', 'A', '2023-08-11 14:45:56'),
(618, 'PRC006', 'PR618', 'OFADA RICE X 1 PAINT PLASTIC (100% ORIGINAL)', 'Buy Ofada rice online in Lagos- Ofada rice in one whole grain that is healthy for consumption, compared with other rice grain. Ofada rice is popular amongst the health conscious people in Nigeria and abroad. Ofada rice can be served on occasion, and is better served hot. Ofada rice is available in wholesale and retail quantities. Buy ofada rice on agrohandlers today. Ofada rice is deliver to Lagos, UK, Canada and USA', 'A', '2023-08-11 14:54:43'),
(619, 'PRC006', 'PR619', 'WHITE RICE OR TUWO RICE X 1 PAINT PLASTIC', 'Buy white rice online in Lagos- White rice in one whole grain that is healthy for consumption in the northern part of Nigeria. White rice recently gained popularity, due to the new discovery, as it\'s been mixed with a small size of cassava flour to make what is now referred to as \"Rice/Cassava Poundo\". White rice (Tuwo rice) when prepared gives the look, texture and poundo-yam taste. White rice poundo is prepared just as we prepare our Semo and poundo yam, You eat this food with all kinds of soup that you use to eat Amala, Eba, Yam flour / poundo yam, Semo, etc. Buy white rice on agrohandlers today. White rice is delivered to Lagos.', 'A', '2023-08-11 15:06:48'),
