(673, 'PRC010', 'PR673', 'COMPLAN MILK (VANILLA FLAVOR) 450G', 'Complan food online- Buy Complan complete meal from Agrohandlers whenever you need nutritious, healthy, and easy-to-drink milk with natural milk taste. Complan is a complete meal in a drink. Complan is much more than just a milk drink, it is a complete nutrition. Complan is easy to prepare and contains a balanced combination of fat protein, fat, carbohydrate, vitamins and minerals, with one serving providing around 250 calories. Ideal for; Busy People, Athletes Elderly and convalescent Pregnant and nursing mother. Shop Complan on agrohandlers, your one-stop marketplace for bulk; food, raw food items and groceries. Complan Milk is available for delivery in Lagos at retail or wholesale prices on agrohandlers', 'A', '2023-08-15 17:10:35'),
